John Verdun (Jack) Newton (12 April 1916 – 14 January 1944) was elected to the Parliament of Western Australia, while serving as a Royal Australian Air Force (RAAF) pilot in Europe, during World War II. Newton won the seat of Greenough at the 1943 State election, but was killed in action 55 days later. While many other members of Australian parliaments (MPs) have simultaneously served in wars, Newton's tenure was unusual, because he was: 
*  both preselected and elected while he was overseas; 
*  one of only a few serving members of Australian parliaments to fly on combat operations; 
*  neither sworn in nor able to sit in Parliament, and;  
*  killed in action while he was a MP.

Rev. Jerome Dhas Varuvel, SDB, was born 21 October 1951 in Paduvoor in the diocese of Kottar.He attended Carmel Secondary School in Nagercoil. From 1967 to 1968 he followed the pre-university course at the Scott Christian College, Nagercoil.From 1968 to 1970 he attended the minor seminary at St. Aloysius Seminary in Nagercoil. He studied philosophy at Sacred Heart Seminary in Poonamallee (1970-1973). He also obtained a bachelor's degree in Economics from Arulanandar College, Karumathur, Madurai (1973-1976). In 1976 he decided to join the Salesians of Don Bosco.After completing the pre-novitiate (1976-1977) and novitiate (1977-1978), made his religious profession temporary 24 May 1978.On 24 May 1981 he made his perpetual vows. From 1981 to 1986 he studied theology at the Salesians in Rome.He has a bachelor's degree in Economics and in Theology and a Licentiate in Pedagogy at the Pontifical Salesian University in Rome. He was ordained priest by St. John Paul II on 2 June 1985. It belongs to the Salesian Province of Chennai, Tamil Nadu. After ordination he held the following positions: 
* 1985-1986: Completion of studies at the Pontifical Salesian University (Rome); 
* 1986-1990: Vice-Rector of the Novitiate in Vellakinar; 
* 1990-1992: Rector of the Pre-Novitiate in Tirupattur; 
* 1992-1994: Rector of the Pre-Novitiate in Maiyam; 
* 1994-1996: Dean of Student Salesian Trichy; 
* 1996-2001: Pastor-Rector of the Con-Cathedral of Madras-Mylapore; 
* 1999-2003: Provincial Councillor; 
* 2001-2002: Director of Kalvi Solai (Center for education and culture), Tirupattur; 
* 2002-2003: Director of Kalvi Solai (Center for education and culture), Ennore; 
* 2003-2010: Director of Mount Don Bosco in Thalavadi, Erode; 
* Since 2010 he is Director of Novices at Yeallagiri Hills, Diocese of Vellore.
